const img2 = 'https://picsum.photos/id/237/200/300';
const img3 = 'https://picsum.photos/200/300?grayscale';

ReactDOM.render(
  <>
    <h1 style={{ marginTop: 50, marginLeft: 50 }}> margin top</h1>
    <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Consectetur optio quos qui delectus consequatur,
    </p>
    nobis, neque, dolor ipsum quam fugiat possimus reprehenderit? Adipisci deleniti assumenda neque aspernatur est. Veritatis, dignissimos!


    <p>
      {/* <img src={'https://picsum.photos/400/300?grayscale'} alt='image1' /> */}

      <img src={img1} alt='image2' />

      <img src={img2} alt='image2' />

      <img src={img3} alt='image3' />
    </p>

    <div class="intro">
      <p>My name is Sandeep Saini.</p>
      <p>I live in Haryana.</p>
    </div>
  </>,
  document.getElementById("root")
);
